import React from 'react';
import { Card } from 'antd';
import './styles.css';
class CardComponent extends React.Component {
	render() {
		return (
			<Card style={{ width: 200, height: 300 }} className="Card">
				<p>Làm quen với thay đổi màu background</p>
				<p>Hello</p>
			</Card>
		);
	}
}
export default CardComponent;
